import React from "react";
import classes from "./HomeWorks.module.css";
import { useState } from "react";
import manstand from "../../../assets/manstand.png";
import worklaptop from "../../../assets/worklaptop.png";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHtml5 } from '@fortawesome/free-brands-svg-icons';
import { faCss3 } from '@fortawesome/free-brands-svg-icons';
import { faJs } from '@fortawesome/free-brands-svg-icons';
import { faReact } from '@fortawesome/free-brands-svg-icons';
import { faNodeJs } from '@fortawesome/free-brands-svg-icons';
import { faNpm } from '@fortawesome/free-brands-svg-icons';
import { faYarn } from '@fortawesome/free-brands-svg-icons';


const HomeWorks = () => {
  return (
    <React.Fragment>
      <div className={classes.workhead}>
        <h1>What I Do ?</h1>
      </div>
      <div className={classes.hbox}>
        <div className={classes.hleftBox}>
          <img className={classes.man} src={manstand} />
          <img className={classes.lappy} src={worklaptop} />
        </div>
        <div className={classes.hrightBox}>
          <div className={classes.head1}>
            <h2>Full Stack Development</h2>
          </div>
          <div className={classes.head2}>
            <div className={classes.html}><FontAwesomeIcon icon={faHtml5}/></div>
            <FontAwesomeIcon className={classes.css} icon={faCss3} />
            <FontAwesomeIcon className={classes.js} icon={faJs} />
            <FontAwesomeIcon icon={faReact} />
            <FontAwesomeIcon icon={faNodeJs} />
            <FontAwesomeIcon icon={faNpm} />
            <FontAwesomeIcon icon={faYarn} />
          </div>
        </div>
      </div>
    </React.Fragment>
  );
};

export default HomeWorks;
